import React from 'react'
import showcase1 from '../../assets/showcase1.png'
import './index.css'

const Showcase=()=>{
    return(
        <section className='space-showcase section-margin'>
            <div className='slide-in-right slide-out-left'>
                <img src={showcase1} alt="" />
            </div>
        </section>
    )
}
export default Showcase
